import React from 'react';
import { Button, ThemeProvider, createMuiTheme } from '@material-ui/core';

function App() {
  const theme = createMuiTheme({
    palette:{ 
      primary: {
        main: '#d32f2f',
      }
    }

  });
  return (
    <ThemeProvider theme={theme}>
      <Button variant='contained' color="secundary">Daniel</Button>
    </ThemeProvider>
  )
}

export default App;
